import React from 'react';
import axios from 'axios';
import './App.css';

class App extends React.Component {
  state = {
    persons:[]
  }

  componentDidMount(){
    fetchUserData();
  }

  fetchUserData(){
    axios.get('https://jsonplaceholder.typicode.com/users ')
    .then(res => {
      const persons = res.data;
      this.setState({persons});
    });
  }

  render(){
    return(
      <div className = "App">
        <h1>Test Header</h1>
      </div>
    );
  }
}

export default App;
